script: |
  super -f text -I q4444.spq | sort > q4444.out

inputs:
  - name: q4444.spq
    data: |
      SELECT ALL - col0 * - + 99 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 / + ( - col0 ) + - col1 BETWEEN NULL AND ( + col0 * - + col1 * + - col2 );
  - name: tab0

outputs:
  - name: q4444.out
    data: |
